  }
loginAgain(){
  this.props.history.push(`/rmPortal`);
}
  render() {
    const details = this.state.details;
console.log("dgfdf",details)
    return (
      <div style={{ backgroundColor: "#D6EAF880" }} className="container-fluid">
    {details.status=="error"? <Alert 
      message="Error: Please retry later. If the error persists, contact the admin."
